import React from 'react'

function Login() {
  return (
    <div>
      <form action="">
        <h3>Ravis de vous revoir</h3>
        <p>Connecter votre compte</p>
        <input type="text" placeholder='Numero'/>
      </form>
    </div>
  )
}

export default Login
